# Modelo Regressão Linear

## Os dados

### Importando os dados
"""

import pandas as pd

dados = pd.read_csv('advertising.csv')

"""### Visualizando os dados"""

# @title
dados.head() #As primeiras linhas da tabela

dados.info() #As informações da tabela

dados.describe() #Algumas estatisticas da tabela

"""### Separando os dados"""

x = dados[['TV','Radio','Newspaper']] #As observações

y = dados['Sales'] #O "Target"

x.shape #Verificando o tamanho do eixo X

y.shape #Verificando o tamanho do eixo y

"""**Separando os dados de treino e teste**"""

from sklearn.model_selection import train_test_split

x_treino, x_teste, y_treino,y_teste = train_test_split(x,y, test_size=0.20) #Separando os dados de treino e de teste. X e Y, cada um irao ser divididos desta forma

"""### Verificando a relação entre os dados (x com y)

**Usando o seaborn para verificar**
"""

import seaborn as sns

sns.pairplot(dados, x_vars=['TV','Radio','Newspaper'], y_vars='Sales', size=7, kind='reg')

"""**Usando o Numpy para verificar**"""

import numpy as np

x_var =  dados[['TV','Radio','Newspaper']].values #Coletando somente os valores das variaveis observacoes

y_var =  dados['Sales'].values #coletando somente o valor do algo

correlacao = np.corrcoef(x_var.T,y_var)

correlacao

"""*Abaixo um grafico que mostra como funciona o nivel de relação, que vai de -1 a 1*



*![image.png](data:image/png;base64,)

**Observação!**

Com que foi visto acima, conseguimos visualizar ha uma relação entre o valor investido em cada area com as vendas. E conseguimos verificar tambem que o Jornal "NewPaper" tem a relação mais fraca

## Importação/Treino/Teste/Performance do Modelo

### Importação
"""

from sklearn.linear_model import LinearRegression

reglin = LinearRegression()

"""### Treino"""

reglin.fit(x_treino, y_treino) #Comando que é feito para treinar o nosso modelo. Passando os dados de treino

reglin.coef_ # (TV, Radi, Newspaper). Codigo abaixo mostra o coeficiente de cada variavel: a cada unidade vendida tem o aumento n. Exemplo: a cada uma unidade investida em TV, tem o aumento de 0.06% de vendas

"""### Previsao"""

previsao = reglin.predict(x_teste)
previsao

"""### Avaliacao da performance

**MAE**
"""

from sklearn import metrics
metrics.mean_absolute_error(y_teste,previsao)

"""**RMSE**"""

np.sqrt(metrics.mean_squared_error(y_teste,previsao))

"""## OBSERVAÇÃO

Como foi visto, a variavel Jornal (Newpaper) não tem muita interferencia em relação ao investimento em impacto com as vendas. Fazendo com que a variavel não tenha tanta relevancia. Provavelmente esta variavel deva estar confundido a maquina quando passada para treinamento. Para isso, vamos fazer um teste usando a combinacao de variaveis e verificar qual a menor media, e verificarmos se na realidade nao usando esta variavel a media de erro diminua.

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)
"""

testes = [['TV','Radio','Newspaper'],['Radio','Newspaper'],['TV','Newspaper'], ['TV','Radio']]

for teste in testes:
    x = dados[teste]
    y = dados['Sales']
    x_train, x_test,y_train,y_test = train_test_split(x,y,test_size=0.30, random_state=5)
    reglin.fit(x_train,y_train)
    previsao = reglin.predict(x_test)
    rmse = np.sqrt(metrics.mean_squared_error(y_test,previsao))
    print('Teste: ')
    print(teste)
    print('perfomance: ')
    print(rmse)